import React, { useEffect, useState } from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import InputSection from "./components/InputSection";
import PredictedCareer from "./components/PredictedCareer";
import SalaryInsights from "./components/SalaryInsights";
import JobInsights from "./components/JobInsights";
import CareerRoadmap from "./components/CareerRoadmap";
import ResumeAnalysis from "./components/ResumeAnalysis";
import ResumeBuilder from "./components/ResumeBuilder";
import Navbar from "./components/Navbar";
import axios from "axios";

function App() {
  const [careerData, setCareerData] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  const handlePredict = async (skills) => {
    try {
      setLoading(true);
      setError(null);
      setCareerData(null);

      const response = await axios.post("http://localhost:5000/predict", {
        skills: skills,
      });

      if (response.data && response.data.insights) {
        setCareerData(response.data);
      } else {
        setError("No career insights found for the prediction.");
      }
    } catch (err) {
      setError("Error predicting career. Please try again.");
      console.error("Error:", err);
    } finally {
      setLoading(false);
    }
  };

  const HomePage = () => (
    <div className="min-h-screen bg-gray-100 p-6">
      <h1 className="text-3xl font-bold text-center mb-8 text-indigo-600">
        Welcome to Career Predictor
      </h1>
      <div className="max-w-4xl mx-auto bg-white rounded-lg shadow-md p-6">
        <p className="text-lg text-gray-700 mb-4">
          Discover your perfect career path with our AI-powered career
          prediction system.
        </p>
        <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
          <div className="bg-indigo-50 p-4 rounded-lg">
            <h2 className="text-xl font-semibold text-indigo-800 mb-2">
              Career Prediction
            </h2>
            <p className="text-gray-600">
              Get personalized career recommendations based on your skills and
              interests.
            </p>
          </div>
          <div className="bg-indigo-50 p-4 rounded-lg">
            <h2 className="text-xl font-semibold text-indigo-800 mb-2">
              Resume Tools
            </h2>
            <p className="text-gray-600">
              Build and analyze your resume with our professional tools.
            </p>
          </div>
          <div className="bg-indigo-50 p-4 rounded-lg">
            <h2 className="text-xl font-semibold text-indigo-800 mb-2">
              Career Insights
            </h2>
            <p className="text-gray-600">
              Get detailed information about salary ranges, required skills, and
              growth opportunities.
            </p>
          </div>
        </div>
      </div>
    </div>
  );

  const CareerPredictionPage = () => (
    <div className="min-h-screen bg-gray-100 p-6">
      <h1 className="text-3xl font-bold text-center mb-8 text-indigo-600">
        Career Predictor
      </h1>

      {/* Input Section */}
      <InputSection onPredict={handlePredict} loading={loading} />

      {/* Error Message */}
      {error && (
        <div
          className="bg-red-100 border border-red-400 text-red-700 px-4 py-3 rounded relative mb-4"
          role="alert"
        >
          <span className="block sm:inline">{error}</span>
        </div>
      )}

      {/* Career Insights */}
      {careerData && (
        <div className="max-w-4xl mx-auto space-y-6">
          {/* Predicted Career */}
          <PredictedCareer career={careerData.prediction} />

          {/* Career Roadmap */}
          {careerData.insights && (
            <CareerRoadmap insights={careerData.insights} />
          )}

          {/* Salary Insights */}
          {careerData.insights && (
            <SalaryInsights insights={careerData.insights} />
          )}

          {/* Job Insights */}
          {careerData.insights && (
            <JobInsights insights={careerData.insights} />
          )}
        </div>
      )}
    </div>
  );

  const ResumeToolsPage = () => {
    const [activeTab, setActiveTab] = useState("analysis"); // 'analysis' or 'builder'

    return (
      <div className="min-h-screen bg-gray-100 p-6">
        <h1 className="text-3xl font-bold text-center mb-8 text-indigo-600">
          Resume Tools
        </h1>
        <div className="max-w-4xl mx-auto">
          {/* Tab Navigation */}
          <div className="flex justify-center mb-6">
            <div className="bg-white rounded-lg shadow-sm p-1">
              <button
                onClick={() => setActiveTab("analysis")}
                className={`px-6 py-2 rounded-md text-sm font-medium ${
                  activeTab === "analysis"
                    ? "bg-indigo-600 text-white"
                    : "text-gray-600 hover:text-gray-900"
                }`}
              >
                Resume Analysis
              </button>
              <button
                onClick={() => setActiveTab("builder")}
                className={`px-6 py-2 rounded-md text-sm font-medium ${
                  activeTab === "builder"
                    ? "bg-indigo-600 text-white"
                    : "text-gray-600 hover:text-gray-900"
                }`}
              >
                Resume Builder
              </button>
            </div>
          </div>

          {/* Tab Content */}
          <div className="bg-white rounded-lg shadow-md p-6">
            {activeTab === "analysis" ? (
              <ResumeAnalysis requiredSkills={[]} />
            ) : (
              <ResumeBuilder />
            )}
          </div>
        </div>
      </div>
    );
  };

  return (
    <Router>
      <div>
        <Navbar />
        <Routes>
          <Route path="/" element={<HomePage />} />
          <Route path="/career-prediction" element={<CareerPredictionPage />} />
          <Route path="/resume" element={<ResumeToolsPage />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
